import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "../Common/Navbar";
import Footer from "../Common/Footer";
import HeaderBar from "../Common/HeaderBar";
import "./UserPreferences.css";

const UserPreferences = () => {
  const navigate = useNavigate();

  const [preferences, setPreferences] = useState({
    location: "",
    experience: "",
    speciality: "",
    minConsultationFee: "",
    maxConsultationFee: "",
    availabilityStatus: "",
  });

  const handleChange = (e) => {
    setPreferences({ ...preferences, [e.target.name]: e.target.value.trim() });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Ensure all fields are filled
    if (Object.values(preferences).some((value) => value === "")) {
      alert("Please fill in all the fields.");
      return;
    }

    // Ensure minConsultationFee is not greater than maxConsultationFee
    const minFee = Number(preferences.minConsultationFee);
    const maxFee = Number(preferences.maxConsultationFee);

    if (minFee > maxFee) {
      alert("Minimum fee cannot be greater than maximum fee.");
      return;
    }

    // Prepare query params for navigation
    const queryParams = new URLSearchParams({
      location: preferences.location,
      experience: preferences.experience,
      speciality: preferences.speciality,
      consultationFee: `${minFee}-${maxFee}`, // Combine min & max fee
      availabilityStatus: preferences.availabilityStatus,
    }).toString();

    navigate(`/doctor-list?${queryParams}`);
  };

  return (
    <div>
      <HeaderBar />
      <Navbar />

      <div className="user-preferences-container">
        <h2>Select Your Preferences</h2>

        <form onSubmit={handleSubmit} className="preferences-form">
          {/* Location Dropdown */}
          <label>Location:</label>
          <select name="location" value={preferences.location} onChange={handleChange}>
            <option value="">Select Location</option>
            <option value="pen">Pen</option>
            <option value="kharghar">Kharghar</option>
            <option value="panvel">Panvel</option>
            <option value="chicago">Chicago</option>
            <option value="kalyan">Kalyan</option>
          </select>

          {/* Experience Input */}
          <label>Experience (Years):</label>
          <input type="number" name="experience" value={preferences.experience} onChange={handleChange} min="0" />

          {/* Speciality Dropdown */}
          <label>Speciality:</label>
          <select name="speciality" value={preferences.speciality} onChange={handleChange}>
            <option value="">Select Speciality</option>
            <option value="heart">Heart</option>
            <option value="neurologist">Neurologist</option>
            <option value="dermatologist">Dermatologist</option>
          </select>

          {/* Consultation Fee Range */}
          <label>Consultation Fee Range (INR):</label>
          <div className="consultation-fee-range">
            <input type="number" name="minConsultationFee" placeholder="Min Fee" value={preferences.minConsultationFee} onChange={handleChange} min="0" />
            <span> - </span>
            <input type="number" name="maxConsultationFee" placeholder="Max Fee" value={preferences.maxConsultationFee} onChange={handleChange} min="0" />
          </div>

          {/* Availability Status Dropdown */}
          <label>Availability Status:</label>
          <select name="availabilityStatus" value={preferences.availabilityStatus} onChange={handleChange}>
            <option value="">Select Availability</option>
            <option value="9_to_12">9 AM - 12 PM</option>
            <option value="2_to_5">2 PM - 5 PM</option>
            <option value="6_to_9">6 PM - 9 PM</option>
          </select>

          {/* Submit Button */}
          <button type="submit" className="submit-btn">Find Doctors</button>
        </form>
      </div>

      <Footer />
    </div>
  );
};

export default UserPreferences;
